import React, { lazy, Suspense, useEffect } from "react";
import "./App.css";
import HelloElement from "./";
import Home from "./components/Home";
import Navbar from "./components/Navbar";
import Contact from "./components/Contact";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import InLineLoader from "./shared-components/InlineLoader";
import { BRAND } from "./Constants/pages";

const Brand = lazy(() => import('./components/Brand'));

const SusspenseLoading = ({ children }) => (
  <Suspense fallback={<InLineLoader />}>
    {children}
  </Suspense>
);

class App extends React.Component {
  state = {
    bootcamp: "Rookies",
    homeClass: "",
  };

  updateName() {
    this.setState({
      isShowHelloElement: !this.state.isShowHelloElement,
      bootcamp: "sdfalsfjlsd",
    });
  }

  handleSearchKey(e) {
    console.log(e.target.value);
  }


  render() {
    return (
      <Router>
        <div className="App">
          <Navbar onSearchKey={(e) => this.handleSearchKey(e)} />

          <SusspenseLoading>
            <Switch>
              <Route exact path="/">
                <Home bootcamp={this.state.bootcamp} />
              </Route>
                <Route exact path="/contact">
              <Contact />
              </Route>
                <Route exact path="/hello">
              <HelloElement />
              </Route>

              <Route path={BRAND}>
                <Brand />
              </Route>
          </Switch>
         </SusspenseLoading>
        </div>
      </Router>
    );
  }
}

export default App;
